import React from 'react';
import './App.css';

function App() {
  return (
    <div className='wrapper'>
      <header className='header'>

      <aside className='logo'>Portfolio</aside>

      <aside className='navBar'>
        <nav>
          <ul>
            <li></li>
            <li></li>
            <li></li>
          </ul>
        </nav>
      </aside>

      </header>
    </div>
  );
}

export default App;
